import React, { useState } from 'react' 
import { useHistory } from "react-router-dom";

function Navigation() {
    const history = useHistory();
    const navigateTo = () => history.push('/AcctPage');

    return (
     <div>
        <button onClick={navigateTo} type="button" />
     </div>
    );
  }
  export default Navigation;
